import '../css/home.css' ;
import Navbar from '../component/navbar';
import { Fragment } from 'react';

import ContenBox1 from '../component/contentBox1';
import Scolltotop from '../component/ScollToTop';
function home() {

    return (
        <body>

            <Navbar></Navbar>
            <section class="landingpage">
                <ContenBox1></ContenBox1>
                <ContenBox1></ContenBox1>

                <section class="hero" >
                    <iframe id="" width="560" height="315" src="https://www.youtube.com/embed/UVzVUDXoi0Y" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
                </section>

                <Fragment>
                    <Scolltotop></Scolltotop>
                </Fragment>
            </section>





        </body>
    );
  }

  export default home;
